const { hot } = require("react-hot-loader/root")

// prefer default export if available
const preferDefault = m => (m && m.default) || m


exports.components = {
  "component---src-pages-404-tsx": hot(preferDefault(require("C:\\Users\\admin\\react\\Website\\web\\src\\pages\\404.tsx"))),
  "component---src-pages-index-tsx": hot(preferDefault(require("C:\\Users\\admin\\react\\Website\\web\\src\\pages\\index.tsx"))),
  "component---src-pages-using-typescript-tsx": hot(preferDefault(require("C:\\Users\\admin\\react\\Website\\web\\src\\pages\\using-typescript.tsx")))
}
